import { Button, CardMedia, Container, Dialog, DialogActions, DialogContent, DialogContentText, DialogTitle, TextField, Typography } from "@mui/material";
import { Box } from "@mui/system";
import { useEffect, useState } from "react";
import { useNavigate } from "react-router";
import DialogBox from "../../myComponents/dialogBox/DialogBox";
import NavBar from "../../myComponents/navbar/Navbar";
import "./style.css"

export default function HomePage() {

  const getDataFromLS = () => {
    const data = localStorage.getItem('data');
    if (data) {
      return JSON.parse(data);
    }
    else {
      return []
    }
  }

  const navigate = useNavigate();
  const [data, setData] = useState(getDataFromLS());

  function handleRemove() {
    localStorage.clear("data");

  }

  useEffect(() => {
    var data = JSON.parse(localStorage.getItem('data'));
    setData(data);
  }, [data])


  //dialogBOx
  const [open, setOpen] = useState(false);

  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };


  return (
    <Container>
      <NavBar />
      <Box className="header" sx={{ padding: "45px 60px", mb: "10px", borderRadius: "15px" }}>
        <Box>
          <Typography variant='small'>Number Of Crypto Coins Types</Typography> <br />
          <Typography variant='small'>{data?.length}</Typography>
        </Box>

        <Box>
          <Typography variant='small'>Number Of Crypto Coins</Typography> <br />
          <Typography variant='small'>{data?.reduce(function (sum, current) {
            return sum + current.value;
          }, 0)
          }</Typography> <br />

        </Box>
      </Box>
      {<Box>
        {
          data?.map((item, index) => (
            <Box key={index} className="content" sx={{ padding: "15px", mb: "10px" }}>
              <Box sx={{ display: "flex", justifyContent: "space-between", padding: "15px" }}>
                <Box sx={{ display: "flex", width: "50px" }}>
                  <CardMedia
                    sx={{ pr: "10px" }}
                    component="img"
                    height="30"
                    width="30"
                    image={item.image}
                    alt={item.name}
                  />
                  <Typography sx={{ pt: "5px" }} variant="small">{item.name} </Typography>
                </Box>
                <Box sx={{ pt: "5px" }}>
                  <Typography variant="small">
                    {item.value}
                  </Typography>
                </Box>
                <Box>
                  <Button sx={{ mr: "10px" }} onClick={handleClickOpen} variant="contained">exchange</Button>
                  <Button onClick={handleRemove} variant="contained">Remove</Button>
                </Box>
              </Box>
            </Box>
          ))
        }
      </Box>}
      <Dialog open={open} onClose={handleClose}>
        <DialogTitle>Subscribe</DialogTitle>
        <DialogContent>
          <DialogContentText>
            To subscribe to this website, please enter your email address here. We
            will send updates occasionally.
          </DialogContentText>
          <TextField
            autoFocus
            margin="dense"
            id="name"
            label="Email Address"
            type="email"
            fullWidth
            variant="standard"
          />
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose}>Cancel</Button>
          <Button onClick={handleClose}>Subscribe</Button>
        </DialogActions>
      </Dialog>
    </Container>
  )
}
